import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/ProductList.css';

const ProductList = ({ products }) => {
  const navigate = useNavigate();

  const handleNavigation = () => {
    navigate('/products');
  };

  return (
    <div className="product-list">
      <div className="product-card" onClick={handleNavigation}>
        <img src="./Images/Blazer_1.jpg" alt="Blazer" />
        <div className="product-info">
          <h2>Blazer</h2>
          <button className="product-button">Blazer</button>
        </div>
      </div>
      <div className="product-card" onClick={handleNavigation}>
        <img src="./Images/Sherwani_1.jpg" alt="Sherwani" />
        <div className="product-info">
          <h2>Sherwani</h2>
          <button className="product-button">Sherwani</button>
        </div>
      </div>
    </div>
  );
};

export default ProductList;
